import logo from './logo.svg';
import './App.css';
import Header from './componants/Header';
import { toast, ToastContainer } from 'react-toastify';
import { Button } from 'bootstrap';

function App() {

  const btnHandle = ()=>{
    toast.success("done");
  }
  return (
    <div>
      <ToastContainer />
      <h1>This</h1>
      <Button color="warning" outline onClick={btnHandle}>
        First React button
      </Button>
      <h1>hello</h1>
      <Header name="sagar"/>
    </div>
  );
}

export default App;
